describe('ViewPotentialClientInvoicesComponent', () => {
  let component: ViewPotentialClientInvoicesComponent;
  let fixture: ComponentFixture<ViewPotentialClientInvoicesComponent>;
  let trustAccountService: TrustAccountService;
  let billingService: BillingService;
  let invoiceService: InvoiceService;
  let tenantService: TenantService;
  let potentialClientBillingService: PotentialClientBillingService;
  let toastr: ToastDisplay;
  let router: Router;

  beforeEach(async(() => {
    TestBed.configureTestingModule({
      imports: [
        SharedModule,
        RouterTestingModule,
        HttpClientTestingModule,
        ToastrModule.forRoot({
          closeButton: true
        }),
        ApiModule.forRoot({
          rootUrl: 'https://sc1-api.lexiconservices.com',
        }),
        StoreModule.forRoot(reducers),
        BrowserAnimationsModule
      ],
      declarations: [ ViewPotentialClientInvoicesComponent ],
      providers: [
        CustomAppConfigService,
        {
          provide: AppConfigService,
          useClass: CustomAppConfigService,
        },
      ],
    })
    .compileComponents();
  }));

  beforeEach(() => {
    fixture = TestBed.createComponent(ViewPotentialClientInvoicesComponent);
    trustAccountService = TestBed.get(TrustAccountService);
    billingService = TestBed.get(BillingService);
    invoiceService = TestBed.get(InvoiceService);
    tenantService = TestBed.get(TenantService);
    potentialClientBillingService = TestBed.get(PotentialClientBillingService);
    toastr = TestBed.get(ToastDisplay);
    router = TestBed.get(Router);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

  it('should create', () => {
    expect(component).toBeTruthy();
  });

  it('should called trustaccounting status, invoice list success', () => {
    component.clientDetail = clientDetailMock;
    spyOn(billingService, 'v1BillingInvoicestatusGet').and.returnValue(of(JSON.stringify(invoiceStatusMock)) as any);
    spyOn(potentialClientBillingService, 'v1PotentialClientBillingInvoicesContactIdGet').and.returnValue(of(JSON.stringify(invoiceListMock)) as any);
    spyOn(component, 'calcTotalPages').and.callThrough();
    spyOn(UtilsHelper, 'aftertableInit').and.callThrough();

    component.ngOnInit();

    expect(component.invoiceStatusList.length).toBe(2);
    expect(component.invoiceList.length).toBe(2);
    expect(component.originalInvoiceList.length).toBe(2);
    expect(component.calcTotalPages).toHaveBeenCalled();
    expect(UtilsHelper.aftertableInit).toHaveBeenCalled();
    expect(component.loading).toBe(false);
    expect(component.rateMin).toBe(133);
    expect(component.rateMax).toBe(451);
  });

  it('should called trustaccounting status, invoice list null results', fakeAsync(() => {
    component.clientDetail = clientDetailMock;
    spyOn(billingService, 'v1BillingInvoicestatusGet').and.returnValue(of(JSON.stringify({token: 'fake-token', results: []})) as any);
    spyOn(potentialClientBillingService, 'v1PotentialClientBillingInvoicesContactIdGet').and.returnValue(of(JSON.stringify({token: 'fake-token', results: null})) as any);

    component.ngOnInit();
    tick(1);

    expect(component.loading).toBe(false);
    expect(component.invoiceStatusList.length).toBe(0);
    flush();
  }));

  it('should called trustaccounting status',  fakeAsync(() => {
    spyOn(trustAccountService, 'v1TrustAccountGetTrustAccountStatusGet$Response').and.returnValue(of({ body: JSON.stringify({token: 'fake-token', results: true})}) as any);
    
    component.checkTrustAccountStatus().then(() => {});
    tick(1);
    expect(component.trustAccountStatus).toBe(true);
    flush();  
  }));

  it('should filtered based on service date selected ', () => {
    component.originalInvoiceList = invoiceListMock.results;
    component.startServiceDate = "2021-01-12T00:00:00";
    component.endServiceDate = "2021-01-13T00:00:00";

    component.applyFilter();

    expect(component.invoiceList.length).toBe(1);
  });

  it('should filtered based on billed date selected ', () => {
    component.originalInvoiceList = invoiceListMock.results;
    component.startBilledDate = "2021-01-12T00:00:00";
    component.endBilledDate = "2021-01-13T00:00:00";

    component.applyFilter();

    expect(component.invoiceList.length).toBe(1);
  });

  it('should filtered based on status selected ', () => {
    component.originalInvoiceList = invoiceListMock.results;
    component.selectedStatus = [175];

    component.applyFilter();

    expect(component.invoiceList.length).toBe(0);
  });

  it('should filtered search string', () => {
    component.originalInvoiceList = invoiceListMock.results;
    component.description = '1431';

    component.applyFilter();

    expect(component.invoiceList.length).toBe(1);
  });

  it('emailInvoice', () => {
    component.invoiceList = invoiceListMock.results;
    component.originalInvoiceList = invoiceListMock.results;
    spyOn(billingService, 'v1BillingInvoiceSendInvoiceIdMarkAsMailedGet').and.returnValue(of(JSON.stringify({token: 'fake-token', results : 101}) as any));
    spyOn(toastr, 'showSuccess').and.callThrough();

    component.emailInvoice(invoiceListMock.results[0]);

    expect(toastr.showSuccess).toHaveBeenCalledWith('Invoice sent.');
  });

  it('emailInvoice error', () => {
    component.invoiceList = invoiceListMock.results;
    component.originalInvoiceList = invoiceListMock.results;
    spyOn(billingService, 'v1BillingInvoiceSendInvoiceIdMarkAsMailedGet').and.returnValue(of(JSON.stringify({token: 'fake-token', results : null}) as any));
    spyOn(toastr, 'showError').and.callThrough();

    component.emailInvoice(invoiceListMock.results[0]);

    expect(toastr.showError).toHaveBeenCalledWith('Invoice failed to send.');
  });

  it('bulkaction download invoice', () => {
    component.clientDetail = clientDetailMock;
    component.selectedTableRow = invoiceListMock.results;
    spyOn(billingService, 'v1BillingBillToClientEmailAndPrintPost$Json').and.returnValue(of(JSON.stringify(invoicePDfMock) as any));
    spyOn(toastr, 'showSuccess').and.callThrough();

    component.bulkAction('print');

    expect(toastr.showSuccess).toHaveBeenCalledWith('Invoices have been downloaded.')
  });

  it('bulkaction download invoice', () => {
    component.clientDetail = clientDetailMock;
    component.selectedTableRow = invoiceListMock.results;
    spyOn(billingService, 'v1BillingBillToClientEmailAndPrintPost$Json').and.returnValue(of(JSON.stringify(bulkEmailSendMock) as any));
    spyOn(toastr, 'showSuccess').and.callThrough();
    spyOn(component, 'getInvoiceList').and.callThrough();

    component.bulkAction('email');

    expect(toastr.showSuccess).toHaveBeenCalledWith('Invoices sent & printed.');
    expect(component.getInvoiceList).toHaveBeenCalled();
    expect(component.bulkDownload).toBe(false);
    expect(component.loading).toBe(false);
    expect(component.selectedTableRow.length).toBe(0);
  });

  it('clear filterd', () => {
    component.invoiceStatusList =[
      {
        "id": 174,
        "code": "GENERATED",
        "name": "Generated",
        "email": null,
        "primaryPhone": null,
        "uniqueNumber": 0,
        "cellPhone": null
      },
      {
        "id": 175,
        "code": "CANCELED",
        "name": "Canceled",
        "email": null,
        "primaryPhone": null,
        "uniqueNumber": 0,
        "cellPhone": null
      }
    ];
    component.invoiceList = invoiceListMock.results;
    component.originalInvoiceList = invoiceListMock.results;
    spyOn(component, 'applyFilter').and.callThrough();

    component.clearFilter('status');

    expect(component.selectedStatus.length).toBe(0);
    expect(component.titleInvoiceStatus).toBe('Select invoice status');
    expect(component.applyFilter).toHaveBeenCalled();
  });

  it('select status function should set set title', () => {
    let e = [];
    component.selectStatus(e);
    expect(component.titleInvoiceStatus).toContain('All');
  });

  it('printToPDF should navigate', () => {
    component.clientDetail = clientDetailMock;
    const navigateSpy = spyOn(router, 'navigate');

    component.printToPDF(invoiceListMock.results[0]);

    expect(navigateSpy).toHaveBeenCalledWith([ '/billing/invoices/pdf' ],  { queryParams: { invoiceId: 1432, print: 1, pClientId: 9604 } });
  });

  it('downloadInvoices should navigate', () => {
    component.clientDetail = clientDetailMock;
    component.selectedTableRow = [invoiceListMock.results[0]];
    const navigateSpy = spyOn(router, 'navigate');

    component.downloadInvoices();

    expect(navigateSpy).toHaveBeenCalledWith([ '/billing/invoices/pdf' ],  { queryParams: { invoiceId: 1432, print: 1, pClientId: 9604 } });
  });
});
